let iniciarSesion=()=>new Promise((n,t)=>{let i={userName:$("#userName").val(),password:$("#password").val()};$.ajax({method:"POST",url:"/Account/Autenticar",data:{modelo:i},dataType:"JSON",success:n,error:t})});$(function(){$("#acceder").on("click",function(){iniciarSesion().then(n=>{n.correct?window.location.href="/Home/Index":($("#mensaje").html(n.message),$(".modal").addClass("visible"))})});$("#aceptar").on("click",function(){$(".modal").removeClass("visible")})});